                                                                                                                                                                                                                                                                          ('PERIPHERAL','Sound like a pro and take your production quality up a notch with the Razer Seiren V2 Proâa dynamic USB microphone designed for those serious about streaming. Whether youâre an industry vet or a professional-to-be, enjoy top-notch voice clarity and quality thanks to its suite of high-end features.

